import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { DateRange } from "react-date-range";
import "react-date-range/dist/styles.css"; // style principal
import "react-date-range/dist/theme/default.css"; // thème par défaut
import { addDays } from "date-fns";

export default function Main() {
  const navigate = useNavigate();

  const menuButton = {
    backgroundColor: "#2c3e50",
    color: "#ecf0f1",
    border: "none",
    padding: "10px 15px",
    fontSize: "16px",
    borderRadius: "6px",
    marginBottom: "10px",
    cursor: "pointer",
    width: "200px",
    textAlign: "left",
  };

  // Etats pour Date Range Picker
  const [state, setState] = useState([
    {
      startDate: new Date(),
      endDate: addDays(new Date(), 1),
      key: "selection",
    },
  ]);

  const [destination, setDestination] = useState("Tunisie");
  const [adults, setAdults] = useState(2);
  const [children, setChildren] = useState(0);
  const [rooms, setRooms] = useState(1);

  const handleSearch = () => {
    console.log({
      destination,
      arrival: state[0].startDate,
      departure: state[0].endDate,
      adults,
      children,
      rooms,
    });
    navigate("/user/search");
  };

  return (
    <div style={{ display: "flex", minHeight: "100vh" }}>
      {/* Sidebar */}
      <div style={{ width: "220px", padding: "20px", backgroundColor: "#34495e" }}>
        <h2 style={{
          marginBottom: "30px",
          borderBottom: "2px solid #2980b9",
          paddingBottom: "10px",
          color: "#ecf0f1",
        }}>Menu Utilisateur</h2>

        {/* Boutons comme avant */}
        <button style={menuButton} onClick={() => navigate("/user")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >🏠 Accueil</button>

        <button style={menuButton} onClick={() => navigate("/user/search")}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#2980b9")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >🔍 Recherche Hôtels</button>

        {/* ... tous les autres boutons ... */}

        <button style={menuButton} onClick={() => {
          localStorage.removeItem("token");
          navigate("/login");
        }}
          onMouseEnter={(e) => (e.target.style.backgroundColor = "#c0392b")}
          onMouseLeave={(e) => (e.target.style.backgroundColor = "#2c3e50")}
        >🔓 Déconnexion</button>
      </div>

      {/* Contenu principal */}
      <div style={{ flex: 1, padding: "50px" }}>
        <h1>Hôtels en Tunisie</h1>
        <p>Indiquez vos dates et faites votre choix !</p>

        <div style={{ marginTop: "30px" }}>
          <input
            type="text"
            value={destination}
            onChange={(e) => setDestination(e.target.value)}
            placeholder="Destination"
            style={{ padding: "10px", marginBottom: "20px", width: "200px" }}
          />

          <DateRange
            editableDateInputs={true}
            onChange={(item) => setState([item.selection])}
            moveRangeOnFirstSelection={false}
            ranges={state}
          />

          <div style={{ marginTop: "20px", display: "flex", gap: "10px", flexWrap: "wrap" }}>
            <input
              type="number"
              value={adults}
              onChange={(e) => setAdults(e.target.value)}
              min="1"
              placeholder="Adultes"
            />
            <input
              type="number"
              value={children}
              onChange={(e) => setChildren(e.target.value)}
              min="0"
              placeholder="Enfants"
            />
            <input
              type="number"
              value={rooms}
              onChange={(e) => setRooms(e.target.value)}
              min="1"
              placeholder="Chambres"
            />

            <button onClick={handleSearch} style={{
              padding: "10px 20px",
              backgroundColor: "#2980b9",
              color: "#fff",
              border: "none",
              borderRadius: "6px"
            }}>Rechercher</button>
          </div>
        </div>
      </div>
    </div>
  );
}
